import styled from 'styled-components'

export const themeSection = styled.div`
  max-width: 1200px;
  height: 800px;
  padding: 0 30px; 
  position relative;
  z-index: 1;
  display: flex;
  justify-content: center;
  background: #0c0c0c;
`;

export const descP = styled.p`
  color: #5A6B50;
  font-size: 14px;
`;

export const themeContainers = styled.div`
  display: flex;
  flex-direction: vertical;
  justify-content: center;
`;

export const energySection = styled.div`
  width: 150px;
  height: 150px;
  background: yellow;
`;

export const mineSection = styled.div`
width: 150px;
height: 150px;
background: blue;
`;
